import React from "react";

function RatingsList({ ratings }) {
  return (
    <ul>
      {ratings.map((rating, index) => (
        <li key={index}>
          <h2>{rating.name}</h2>
          <p>Rating: {rating.rating}</p>
        </li>
      ))}
    </ul>
  );
}

export default RatingsList;
